import React from 'react';
import ReactDOM from 'react-dom';
const name = 'Pooja';
const currdate = new Date().ToLocaleDateString();
const currtime = new Date().ToLocaleTimeString();
ReactDOM.render(
  <>
<h1>My name is {name} </h1>
 <p>Date : {currdate}</p>
 <p>Time : {currtime}</p>
</>,
document.getElementById('root')

);
